import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import image from "../Assets/image.png";

const LoginForm = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [rememberMe, setRememberMe] = useState(false);
  const [error, setError] = useState("");

  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();
    setError("");

    try {
      const response = await fetch(
        "https://qa-uaesaas-api.instapract.ae/web/api/default/login",
        {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
            APPID: "Gem3s12345",
          },
          body: JSON.stringify({
            username,
            password,
            role_id: "143f37f2-ca38-0ab1-2489-1e47113655fc",
            device_id:
              "55c3389cb5ddd720dc0297617f3561c43a36218a277c974c8d43d545a643f45c",
            os_id: "b93a9204-ee21-4cf9-8a94-cf5eeabf7301",
            language: "da315627-3ece-2016-c628-b61dc5ee9be0",
          }),
        }
      );

      const result = await response.json();
      if (response.ok && result.success && result.data.access_token) {
        localStorage.setItem("token", result.data.access_token);
        localStorage.setItem(
          "patientProfile",
          JSON.stringify(result.data.PatientProfile)
        );
        navigate("/doctor");
      } else {
        setError(result.msg || "Login failed");
      }
    } catch (err) {
      setError("Something went wrong. Please try again.");
    }
  };

  return (
    <div className="flex min-h-screen w-full p-4 bg-gray-100 gap-6 items-center justify-center">
      {/* Image Section */}
      <div className="relative w-1/2 max-w-xl aspect-[4/5] bg-blue-600 text-white font-semibold overflow-hidden">
        <img
          src={image}
          alt="Login"
          className="absolute inset-0 w-full h-full object-cover brightness-50"
        />
        <p className="absolute top-5 left-5 text-[clamp(1.2rem,4vw,2.5rem)] leading-snug z-10">
          Instapract <br /> User Centric <br /> Teleconsulting,
          <br /> Expert Opinion <br /> Platform.
        </p>
      </div>

      {/* Login Form */}
      <div className="w-1/2 max-w-lg bg-white p-8 shadow-md rounded-lg">
        <form onSubmit={handleLogin} className="space-y-5">
          <div className="text-center">
            <h2 className="text-3xl font-bold text-blue-600">
              <span className="text-black">Insta</span>pract
            </h2>
            <h5 className="text-gray-500 text-sm mt-1">HealthTech IT Solution</h5>
          </div>

          <h2 className="text-xl font-semibold text-gray-700">Login</h2>

          <div className="flex flex-col">
            <label className="mb-1 font-medium text-gray-700">Username</label>
            <input
              type="text"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              required
              className="px-4 py-2 border rounded-md focus:ring-2 focus:ring-blue-500 outline-none"
            />
          </div>

          <div className="flex flex-col">
            <label className="mb-1 font-medium text-gray-700">Password</label>
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
              className="px-4 py-2 border rounded-md focus:ring-2 focus:ring-blue-500 outline-none"
            />
          </div>

          <div className="flex items-center space-x-2 text-sm">
            <input
              type="checkbox"
              id="rememberMe"
              checked={rememberMe}
              onChange={(e) => setRememberMe(e.target.checked)}
              className="w-4 h-4"
            />
            <label htmlFor="rememberMe" className="text-gray-600">
              Remember Me
            </label>
          </div>

          {error && (
            <div className="text-red-600 text-sm font-medium">{error}</div>
          )}

          <button
            type="submit"
            className="w-full py-2 bg-blue-600 text-white rounded-md font-semibold hover:bg-blue-700 transition"
          >
            Login
          </button>
        </form>
      </div>
    </div>
  );
};

export default LoginForm;
